import * as React from 'react';
import PropTypes from 'prop-types';
import './CourseworkTabs.css';
import Tabs from '../../mui_components/Tabs.js'
import Tab from '../../mui_components/Tab.js'
import { useMediaQuery, useTheme } from '@mui/material';
// import theme from '../../theme'


function CustomTabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      className='tab-panel'
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
          <div>{children}</div>
      )}
    </div>
  );
}

CustomTabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

function CourseworkTabs(props) {
  const theme = useTheme();
  const isBelow800px = useMediaQuery(theme.breakpoints.down('lg'));

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const tabVariant = isBelow800px ? 'scrollable' : 'fullWidth';

  return (
    <div className='coursework-info'>
      <Tabs
          className='coursework-info-tabs'
          value={value} 
          onChange={handleChange} 
          variant={tabVariant}
        >
        <Tab label="Computer Science" {...a11yProps(0)} />
        <Tab label="Electrical & Computer Engineering" {...a11yProps(1)} />
        <Tab label="Finance" {...a11yProps(2)} />
        <Tab label="Business" {...a11yProps(3)} />
        <Tab label="IBE" {...a11yProps(4)} />
        <Tab label="General" {...a11yProps(5)} />
      </Tabs>
      <div className='coursework-break' />
      <div className='coursework-panel-wrapper'>
        <CustomTabPanel value={value} index={0}>
          {/* Computer Science */}
          <div class="class-list-container">
            <ul class="class-list-column">
              <li>CSE 340 - Design & Analysis of Algorithms</li>
              <li>CSE 216 - Software Engineering</li>
              <li>CSE 392 - Independent Study</li>
              <li>CSE 264 - Web Systems Programming</li>
              <li>CSE 140 - Discrete Structures & Algorithms</li>
              <li>CSE 411 - Advanced Programming Techniques</li>
              <li>CSE 492 - Independent Study</li>
              <li>CSE 303 - Operating System Design</li>
              <li>CSE 241 - Database Systems & Applications</li>
            </ul>
            <ul class="class-list-column">
              <li>CSE 340 - Design & Analysis of Algorithms</li>
              <li>CSE 216 - Software Engineering</li>
              <li>CSE 392 - Independent Study</li>
              <li>CSE 264 - Web Systems Programming</li>
              <li>CSE 140 - Discrete Structures & Algorithms</li>
              <li>CSE 109 - Systems Software</li>
              <li>CSE 017 - Programming & Data Structures</li>
              <li>CSE 002 - Fundamentals of Programming</li>
              <li>CSE 012 - Survey of CS (AP Credit)</li>
            </ul>
          </div>
        </CustomTabPanel>
        <CustomTabPanel value={value} index={1}>
          {/* Electrical and Computer Engineering */}
          <div class="class-list-container">
            <ul class="class-list-column">
              <li>CREG 258 - Computer Engr Senior Project II</li>
              <li>CREG 257 - Computer Engr Senior Project I</li>
              <li>ECE 201 - Computer Architecture</li>
              <li>ECE 128 - FPGA Lab</li>
              <li>ECE 132 - Microcontroller Lab</li>
              <li>ECE 108 - Signals & Systems</li>
            </ul>
            <ul class="class-list-column">
              <li>ECE 182 - Junior Circuit Lab</li>
              <li>ECE 123 - Electronic Circuits</li>
              <li>ECE 121 - Electronic Circuit Lab</li>
              <li>ECE 081 - Princ of Electrical Engineering</li>
              <li>ECE 033 - Intro to Computer Engineering</li>
            </ul>
          </div>
        </CustomTabPanel>
        <CustomTabPanel value={value} index={2}>
          Item Three
        </CustomTabPanel>
        <CustomTabPanel value={value} index={3}>
          Item 4
        </CustomTabPanel>
        <CustomTabPanel value={value} index={4}>
          Item 5
        </CustomTabPanel>
        <CustomTabPanel value={value} index={5}>
          <li>Game theory</li>
        </CustomTabPanel>
      </div>
  </div>
  );
}

export default CourseworkTabs;
